import logo from './logo.svg';
import './App.css';
import {Map} from './Map';
import {Titlebar} from './Titlebar';
import {Infobar} from './Infobar';
//import { Leaflet, Icon } from "leaflet";
//import 'leaflet/dist/leaflet.css';


function App() {
  return (
    <div>
      <Titlebar />
      <table width="100%">
        <tr>
          <td className="map-container">
          <Map />
          </td>
          <td className="info-container">
          <Infobar num={1}/>
          <Infobar num={2}/>
          </td>
        </tr>     
        </table> 
      </div>
  );
}

export default App;
